//SPDX-License-Identifier: Unlicense
pragma solidity ^0.7.0;

import "../libraries/LibSimpleStake.sol";
import "./SimpleStakeStorage.sol";

abstract contract StakeSetting is SimpleStakeStorage {

    modifier onlyOwner() {
        require(hasRole(ADMIN_ROLE, msg.sender), "StakeSetting: Caller is not an admin");
        _;
    }

    modifier isValidToken(
        address _tokenAddr
    ) {
        require(_allowedTokens[_tokenAddr].allowed);
        _;
    }

    modifier isMediator(
        address _tokenAddr
    ) {
        require(Mediator[_tokenAddr] == msg.sender);
        _;
    }

    /**
    * external
    */
    function changeVault(
        address _fldVault
    )
        external
        onlyOwner
    {
        require(_fldVault != address(0));
        fldVault = IFLDVault(_fldVault);
    }

    function changeWithdrawalDelaySeconds(
        uint256 _seconds
    )
        external
        onlyOwner
    {
        require(_seconds > 0);
        WITHDRAWAL_DELAY_SECONDS = _seconds;
    }

    function changeAnnualInterestRateInfo(
        uint256 _interestRate,
        uint256 _totalBlocks
    )
        public
        onlyOwner
    {
        require(_interestRate > 0 && _totalBlocks > 0);
        interestRatePerYear.interestRate = _interestRate;
        interestRatePerYear.totalBlocks = _interestRate;
    }


    function addToken(
        address _tokenAddr,
        uint256 _fldExchanges,
        uint256 _interestRate
    )
        external
        onlyOwner
    {
        LibSimpleStake.TokenInfo storage tokenInfo = _allowedTokens[_tokenAddr];
        tokenInfo.allowed = true;
        tokenInfo.fldExchangesWeight = _fldExchanges;
        tokenInfo.interestRate = _interestRate;
    }

    function removeToken(
        address _tokenAddr
    )
        external
        onlyOwner
    {
        LibSimpleStake.TokenInfo storage tokenInfo = _allowedTokens[_tokenAddr];
        tokenInfo.allowed = false;
    }

    function changeFldExchangesToken(
        address _tokenAddr,
        uint256 _fldExchanges
    )
        public
        onlyOwner
        isValidToken(_tokenAddr)
    {
        LibSimpleStake.TokenInfo storage tokenInfo = _allowedTokens[_tokenAddr];
        tokenInfo.fldExchangesWeight = _fldExchanges;
    }

    function changeFldExchangesTokens(
        address[] memory _tokenAddrs,
        uint256[] memory _fldExchanges
    )
        external
        onlyOwner
    {
        require(_tokenAddrs.length == _fldExchanges.length, "StakeSetting: Input length is different in changeFldExchangesTokens.");

        for (uint256 i = 0; i < _tokenAddrs.length; i++) {
            changeFldExchangesToken(_tokenAddrs[i], _fldExchanges[i]);
        }
    }


    function changeInterestRateToken(
        address _tokenAddr,
        uint256 _interestRate
    )
        public
        onlyOwner
        isValidToken(_tokenAddr)
    {
        LibSimpleStake.TokenInfo storage tokenInfo = _allowedTokens[_tokenAddr];
        tokenInfo.interestRate = _interestRate;
    }

    function changeInterestRateTokens(
        address[] memory  _tokenAddrs,
        uint256[] memory _fldExchanges
    )
        external
        onlyOwner
    {
        require(_tokenAddrs.length == _fldExchanges.length, "StakeSetting: Input length is different in changeInterestRateTokens.");

        for (uint256 i = 0; i < _tokenAddrs.length; i++) {
            changeInterestRateToken(_tokenAddrs[i], _fldExchanges[i]);
        }
    }

}
